import React from 'react';
import { Image } from 'react-native';

const MyImage = () => {
  return (
    <Image
      source={require('../../assets/logo/')} // Substitua o caminho pela localização da imagem no seu projeto
      style={{ width: 200, height: 200 }}
    />
  );
};

export default MyImage;
